import React from 'react'
import { useParams, Link, useNavigate } from 'react-router-dom'
import { projects } from '../data/projects'
import {
  Box,
  Typography,
  Breadcrumbs,
  Card,
  CardMedia,
  CardContent,
  Stack,
  Button,
  Divider,
  Chip,
} from '@mui/material'
import HomeIcon from '@mui/icons-material/Home'
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth'
import LocationOnIcon from '@mui/icons-material/LocationOn'

const slugify = (text) =>
  text.toLowerCase().replace(/[^\w ]+/g, '').replace(/ +/g, '-')

const projectsWithSlugs = projects.map((p) => ({
  ...p,
  slug: slugify(p.title),
}))

const ProjectDetail = () => {
  const { slug } = useParams()
  const project = projectsWithSlugs.find((p) => p.slug === slug)
  const navigate = useNavigate()

  if (!project) {
    return (
      <Box
        sx={{
          minHeight: '80vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          px: 3,
        }}
      >
        <Typography variant="h4" color="error" gutterBottom>
          Project Not Found
        </Typography>
        <Typography variant="body1" sx={{ mb: 3 }}>
          Sorry, we couldn&apos;t find the project you were looking for.
        </Typography>
        <Button
          variant="contained"
          color="primary"
          onClick={() => navigate('/')}
          size="large"
          sx={{ borderRadius: 3 }}
        >
          Back to Home
        </Button>
      </Box>
    )
  }

  return (
    <Box
      sx={{
        p: { xs: 3, md: 6 },
        backgroundColor: '#EFE6F0',
        minHeight: '100vh',
        maxWidth: 900,
        mx: 'auto',
      }}
    >
      {/* Breadcrumbs */}
      <Breadcrumbs separator="›" aria-label="breadcrumb" sx={{ mb: 4 }}>
        <Link
          to="/"
          style={{ color: '#5A3E61', display: 'flex', alignItems: 'center', textDecoration: 'none' }}
        >
          <HomeIcon fontSize="small" sx={{ mr: 0.5 }} />
          Home
        </Link>
        <Link to="/#projects" style={{ color: '#5A3E61', textDecoration: 'none' }}>
          Projects
        </Link>
        <Typography color="#8A6B95" sx={{ fontWeight: 'bold' }}>
          {project.title}
        </Typography>
      </Breadcrumbs>

      {/* Project Card */}
      <Card
        elevation={6}
        sx={{
          display: 'flex',
          flexDirection: { xs: 'column', md: 'row' },
          borderRadius: 6,
          overflow: 'hidden',
          boxShadow: '0 10px 30px rgba(90, 62, 97, 0.2)',
          backgroundColor: '#fff',
        }}
      >
        <CardMedia
          component="img"
          image={project.image}
          alt={project.title}
          sx={{
            width: { xs: '100%', md: '45%' },
            height: { xs: 280, md: 450 },
            objectFit: 'cover',
            transition: 'transform 0.3s ease',
            '&:hover': {
              transform: 'scale(1.05)',
            },
          }}
        />
        <CardContent
          sx={{
            px: { xs: 4, md: 6 },
            py: { xs: 4, md: 6 },
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            width: { md: '55%' },
          }}
        >
          <Typography
            variant="h4"
            sx={{ fontWeight: 700, color: '#5A3E61', mb: 2, letterSpacing: 1 }}
          >
            {project.title}
          </Typography>

          <Stack direction="row" spacing={4} mb={3}>
            <Stack direction="row" spacing={1} alignItems="center">
              <CalendarMonthIcon color="primary" />
              <Typography variant="subtitle2" color="text.secondary">
                {project.date}
              </Typography>
            </Stack>
            <Stack direction="row" spacing={1} alignItems="center">
              <LocationOnIcon color="primary" />
              <Typography variant="subtitle2" color="text.secondary">
                {project.location}
              </Typography>
            </Stack>
          </Stack>

          <Divider sx={{ mb: 3 }} />

          <Box
            sx={{
              fontWeight: 400,
              color: '#3A2F3B',
              lineHeight: 1.7,
              fontSize: '1rem',
              whiteSpace: 'pre-line',
            }}
            dangerouslySetInnerHTML={{ __html: project.description }}
          />

          <Box sx={{ mt: 4 }}>
            <Button
              variant="outlined"
              onClick={() => navigate('/#projects')}
              sx={{ borderRadius: 3, color: '#5A3E61', borderColor: '#5A3E61' }}
            >
              ← Back to Projects
            </Button>
          </Box>
        </CardContent>
      </Card>
    </Box>
  )
}

export default ProjectDetail
